import React, {Component} from 'React';

class PersonalCard extends Component {
    render() {
        return (
            <div>
                <h1>{this.props.firstName} {this.props.lastName}</h1>
                <p>{this.props.age}</p>
                <p>{this.props.hairColor}</p>
            </div>
        )
    }
}
